import axios from "axios";
import styles from "./Diets.module.css";

export default async function Diets() {
  let aux = [];
  await axios.get("http://localhost:3001/diets").then(({ data }) => {
    let dietas = data.flatMap((element) => element.name);
    aux = [...dietas];
  });
  console.log(aux);
  return <div className={styles.Contenedor}>asdas</div>;
}
